const LightButton = ({ children, type, mt, mb }) => {
  return (
    <button
      style={{ marginTop: `${mt}px`, marginBottom: `${mb}px` }}
      className="light-btn btn"
      type={type}
    >
      {children}
    </button>
  );
};

export default LightButton;
